import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [inputValue, setInputValue] = useState("");

  const metrics = [
    {
      label: "Total Shipments",
      value: "0",
      color: "default",
    },
    {
      label: "Average Flow Rate",
      value: "0 L/min",
      color: "green",
    },
    {
      label: "Unique Products",
      value: "0",
      color: "default",
    },
    {
      label: "Average Quantity",
      value: "0 units",
      color: "default",
    },
  ];

  const suggestions = [
    "Show me total shipments by year",
    "Create a pie chart of product distribution",
    "Bar chart of flow rates by bay code",
    "Show shipment trends over time",
    "Analyze top performing products",
    "Display monthly shipment volumes",
  ];

  const handleAskAI = () => {
    if (inputValue.trim()) {
      alert(`AI Query: ${inputValue}`);
      setInputValue("");
    }
  };

  const handleSuggestionClick = (suggestion) => {
    setInputValue(suggestion);
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") {
      handleAskAI();
    }
  };

  return (
    <div className="app">
      {/* Header */}
      <header className="header">
        <h1>Viz Walker</h1>
        <nav className="header-nav">
          <div className="nav-item active">Dashboard</div>
          <div className="nav-item">AI Chat</div>
          <div className="nav-item">Analytics</div>
          <div className="theme-toggle">ðŸŒ™</div>
        </nav>
      </header>

      {/* Main Content */}
      <main className="main-content">
        <h1 className="dashboard-title">AI-Powered Analytics Dashboard</h1>
        <p className="dashboard-subtitle">
          Real-time insights from 0 shipment records
        </p>

        {/* Metrics Grid */}
        <div className="metrics-grid">
          {metrics.map((metric, index) => (
            <div key={index} className="metric-card">
              <div className="metric-label">{metric.label}</div>
              <div className={`metric-value ${metric.color}`}>
                {metric.value}
              </div>
            </div>
          ))}
        </div>

        {/* AI Assistant Section */}
        <div className="ai-assistant">
          <h2>AI Assistant</h2>

          <div className="ai-input-container">
            <input
              type="text"
              className="ai-input"
              placeholder="Ask me anything about your shipment data..."
              value={inputValue}
              onChange={(e) => setInputValue(e.target.value)}
              onKeyPress={handleKeyPress}
            />
            <button className="ask-button" onClick={handleAskAI}>
              Ask AI
            </button>
          </div>

          <div className="query-suggestions">
            <p>Try these queries:</p>
            <div className="suggestion-tags">
              {suggestions.map((suggestion, index) => (
                <div
                  key={index}
                  className="suggestion-tag"
                  onClick={() => handleSuggestionClick(suggestion)}
                >
                  {suggestion}
                </div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default App;
